import React from 'react';
import { useState, useEffect } from "react";
import cardData from "../../card.json";
import { NavLink } from 'react-router-dom';
/**
* @author
* @function Cardlist
**/

const Cardlist = (props) => {
    let urlPath = "developer/en/api/dummy1";
  return(
    <div className="container">Cardlist
        <div className="row">
            {cardData.map((cardList,index) => {
                return <div className="col-4 card-wrapper mt-2 mb-2">
                    <div className="card">
                    <h4>{cardList.title}</h4>
                    <p>{cardList.description}</p>
                    <div className="linkBox row bottom-xs">
                    <NavLink className="col-12" to='/developer/en/api/dummy1/intro'><p className="intro">{cardList.intro}</p></NavLink>
                    <NavLink to='/developer/en/api/dummy1/guide'><p className="guid ">{cardList.guid}</p></NavLink>
                    <NavLink to='/developer/en/api/dummy1/reference'><p className="intro">{cardList.ref}</p></NavLink>
                    </div>
                    </div>
                    </div>
            })}
        </div>
    </div>
   );
 }


export default Cardlist
